import React, { Component } from 'react'
import AvalibalImg from '../images/availible.png';
export default class Avalibal extends Component {
    render() {
        return (
            <div style={{display:'flex',justifyContent:'space-around',border:'5px solid green',paddingTop:'40px',marginTop:'50px'}}>
                <div style={{border:'5px solid red'}}>
                    <h2>Also Avalibal At</h2>
                </div>
                <div class="img" style={{border:'5px solid red',}}>
                    <div class="img1">
                <img src={AvalibalImg} />
                    </div>
                </div>
            </div>
        )
    }
}
